DEBUG = False

requiredDirectory = "pokemon_xml"

requiredFile = "pokemon_data.py"

backupFile = "pokemon_data_backup.py"

staticUrl = "https://pokedata.pages.dev/data/[id]-[gen].json"

graphqlUrl = "https://beta.pokeapi.co/graphql/v1beta"

headers = {
    "Content-Type": "application/json",
}

graphqlQuery = """
query pokemon_details($pokemonId: Int, $movesetGame: String) {
    pokemon: pokemon_v2_pokemon(where: {
        id: {
            _eq: $pokemonId
        }
    }) {
        name
        dex_id: pokemon_species_id
        weight
        height
        exp_yield: base_experience
        abilities: pokemon_v2_pokemonabilities {
            ability: pokemon_v2_ability {
                name
            }
        }
        types: pokemon_v2_pokemontypes {
            type: pokemon_v2_type {
                name
            }
        }
        stats: pokemon_v2_pokemonstats {
            base_stat
            stat: pokemon_v2_stat {
                name
            }
        }
        levelUpMoves: pokemon_v2_pokemonmoves(
            where: {
                pokemon_v2_movelearnmethod: {
                    name: {
                        _eq: "level-up"
                    }
                }
                pokemon_v2_versiongroup: {
                    name: {
                        _eq: $movesetGame
                    }
                }
            }
            order_by: {
                level: asc
            }
        ) {
            move: pokemon_v2_move {
                name
                power
                type: pokemon_v2_type {
                    name
                }
                category: pokemon_v2_movedamageclass {
                    name
                }
            }
            level
        }
        machineMoves: pokemon_v2_pokemonmoves(
            where: {
                pokemon_v2_movelearnmethod: {
                    name: {
                        _eq: "machine"
                    }
                }
                pokemon_v2_versiongroup: {
                    name: {
                        _eq: $movesetGame
                    }
                }
            }
            order_by: {
                id: asc
            }
        ) {
            move: pokemon_v2_move {
                name
                power
                type: pokemon_v2_type {
                    name
                }
                category: pokemon_v2_movedamageclass {
                    name
                }
            }
        }
        eggMoves: pokemon_v2_pokemonmoves(
            where: {
                pokemon_v2_movelearnmethod: {
                    name: {
                        _eq: "tutor"
                    }
                }
                pokemon_v2_versiongroup: {
                    name: {
                        _eq: $movesetGame
                    }
                }
            }
            order_by: {
                id: asc
            }
        ) {
            move: pokemon_v2_move {
                name
                power
                type: pokemon_v2_type {
                    name
                }
                category: pokemon_v2_movedamageclass {
                    name
                }
            }
        }
        specy: pokemon_v2_pokemonspecy {
            evolution_chain: pokemon_v2_evolutionchain {
                id
                species: pokemon_v2_pokemonspecies(order_by: {
                    id: asc
                }) {
                    name
                    pre_evolution: evolves_from_species_id
                    evolution_condition: pokemon_v2_pokemonevolutions {
                        level: min_level
                        iq: min_happiness
                        item: evolution_item_id
                        held_item: held_item_id
                        trigger: evolution_trigger_id
                        time: time_of_day
                    }
                }
            }
            category: pokemon_v2_pokemonspeciesnames(
                where: {
                    language_id: {
                        _eq: 9
                    }
                }
            ) {
                genus
            }
        }
    }
}
"""

